final List<dynamic> styles = ['.dialog-custom {\n  min-width: 360px;\n}\n\n.material-fab-add {\n  position: fixed !important;\n  z-index: 9999;\n  float: right;\n  bottom: 64px;\n  right: 64px;\n  background-color: #db4437;\n  color: #fff;\n}\n\n.input-container {\n  display: inline-block;\n  padding-top: 0px;\n  padding-bottom: 0px;\n  width: 100%;\n}\n.input-container:focus-within label {\n  display: block;\n  font-size: 12px;\n  color: #4285f4;\n  margin-top: -4px;\n}\n.input-container:not(:focus-within) label {\n  display: block;\n  font-size: 12px;\n  color: rgba(0, 0, 0, 0.54);\n  margin-top: -4px;\n}\n.input-container material-datepicker {\n  display: block;\n  margin-top: 4px;\n}\n.input-container material-dropdown-select {\n  display: block;\n  margin-top: 4px;\n  margin-bottom: 24px;\n}\n\n/*\n// based on AngularDart Gallery - MaterialInput\n// basead on  @include button-color(\$not-raised, \$color) MaterialButton Mixins - THIS DID NOT WORK FINE\n\n  \$color: \$mat-blue;\n  \$selector: \'material-button\';\n  \$raised: \$selector + \'[raised]\';\n  @include button-background-color(\$raised, \$color);\n  @include button-color(\$raised, \$mat-white);\n\n  \$not-raised: \$selector + \':not([raised])\';\n  @include button-color(\$not-raised, \$color);\n*/\n::ng-deep material-button:not([disabled]):not([icon])[raised] {\n  background-color: #4285f4;\n  color: #fff;\n}\n::ng-deep material-button:not([disabled]):not([icon]):not([raised]) {\n  color: #4285f4;\n}\n\n.footer-material-tab {\n  margin-left: -16px;\n  margin-right: -16px;\n  box-sizing: border-box;\n  flex-shrink: 0;\n  padding: 16px 8px 16px 8px;\n  border-top: 1px #e0e0e0 solid;\n}\n\nmaterial-dialog {\n  height: 600px;\n  max-height: 600px;\n}\n\n.wrapper-chart {\n  display: block;\n  position: relative;\n  padding: 0 4px;\n  max-width: 800px;\n  height: 360px;\n  width: 400px;\n  margin-right: 24px;\n}\n\n.wrapper-progress {\n  display: block;\n  max-width: 800px;\n  min-width: 400px;\n}\n'];